import logo from './logo.svg';
import './App.css';
import Reg from './registration';
import Login from './login';
import {BrowserRouter,Switch,Route,Link} from 'react-router-dom';

function App() {
  return (
    <BrowserRouter>
    <div className='container'>
      <div className='row'>
        <div className='col-md-6 justify-content-center my-auto'>
          <Link to='/register' className='btn btn-primary m-2'>Register</Link>
          <Link to='/login' className='btn btn-primary m-2 pl'>Login</Link>                       
        </div>
      </div>
    </div>
    <Switch>
      <Route path='/register'>
        <Reg />
      </Route>
      <Route path='/login'>
        <Login />
      </Route>
    </Switch>
    </BrowserRouter>

  );
}

export default App;
